import React from "react";

import classes from "./Home.module.css";

const Home = (props) => {
  return (
    <div className={classes.home} id={props.id}>
      <div className={classes.content}>
        <div className={classes.details}>
          <div className={classes.left}>
            <div className={classes.title}>
              <h3>
                Hi, I'm <span className={classes["blue-color"]}>Mahdi!</span>
              </h3>
              <h3>Full-Stack Developer</h3>
              <h3>Live in Malaysia</h3>
            </div>
            <div className={classes.subtitle}>
              <p>
                I'm a full-stack developer living in Malaysia for now with
                <span className={classes["blue-color"]}>6+ years</span> of
                experience.
              </p>
            </div>
          </div>
          <div className={classes.right}>right</div>
        </div>
      </div>
    </div>
  );
};

export default Home;
